    render() {
        return (
            <div className={`card card--${this.props.renderPos}`}
                key={this.props.key}
                onClick={this.props.handleClick()}
            >
                <img 
                    src={this.props.info.img_src} 
                    alt="" 
                />
            </div>
        )
    }
}
